      <Typography fontWeight={700} fontSize={18} mb={0.5} color="#00695c">Erasmus Sınavı 1</Typography>
      <Typography fontSize={14} color="#455a64">A2 Testlerine Erasmus Sınavı 1 soruları için tıklayın.</Typography>
